let input = '';

const react = (polymer) => {
	let stack = [];
	
    for (var i = 0, unit; i < polymer.length; i++) {
    		unit = polymer[i];
        let reactionUnit = stack[stack.length - 1];
        if(reactionUnit){
        	reactionUnit = unit.match(/[A-Z]/) ? reactionUnit.toUpperCase() : reactionUnit.toLowerCase();
        }
        if (
            stack.length < 1 ||
            unit == stack[stack.length - 1] ||
            unit != reactionUnit
        )
            stack.push(unit);
        else
            stack.pop();
    }

    return stack.length;
}


const findBadUnitType = (polymer) => {
	const alphabet = [ 'a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z'];
	let smallestPolymer = 50000;
	for(var i= 0; i < alphabet.length; i++) {
		const reactionLength = react(polymer.replace(new RegExp(`${alphabet[i]}`,'gi'),''));
		smallestPolymer = reactionLength < smallestPolymer ? reactionLength : smallestPolymer;
	}
	return smallestPolymer;
}

console.log(`First part: ${react(input)}`);
console.log(`Second part: ${findBadUnitType(input)}`);